import React from 'react';
import Home from './Components/Home'; 
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <h2>Pickly</h2>
      <p>This is the app</p>
      </header>
    </div>
  );
}

export default App;
